import React from "react";
import { HeaderContainer, MainHeader } from "./HeaderStyle";
import Form from "./Form";
const Header = ({ setQuery, query, getData, mealTypes, setMeal, meal }) => {
  return (
    <HeaderContainer>
      <MainHeader>Food App</MainHeader>
      <img
        src="https://i.pinimg.com/564x/e3/f9/c4/e3f9c42f3b449e72123466082ae3eb18.jpg"
        style={{ width: "150px", borderRadius: "40%" }}
        alt="logo"
      />
      <Form
        setQuery={setQuery}
        query={query}
        getData={getData}
        mealTypes={mealTypes}
        setMeal={setMeal}
        meal={meal}
      />
    </HeaderContainer>
  );
};
export default Header;
